        </tr>
        <tr>
            <td style="width: 100%;">
                <input v-model="message_to_send" style="width: 100%;" type="text" />
            </td>
            <td>
                <button v-on:click="send_message">Enviar</button>
            </td>
        </tr>
    </table>
  </div>
} con lógica {
    retorno {
        método data donde {
            retorno {
                propiedad conversation como "".
                propiedad message_to_send como "".
            }.
        }.
        propiedad methods como {
            método send_message con () donde {
                hago socket_io.emit("client to server message", {
                    propiedad message como this.message_to_send.
                }).
                asigno this.message_to_send como "".
            }.
        }.
        método mounted donde {
            @Sección: Subscripción a eventos de Socket.IO
            hago subscribir_a_socket("evento del chat principal", una lambd con (datos) donde {
                incremento this.conversation en "[" + datos.user + "] " + datos.message.
            }).
        }.
        método unmounted donde {
            @Sección: Desubscripción a eventos de Socket.IO
            hago desubscribir_a_socket("evento del chat principal").
        }.
    }.
}.

